window.bookSummaryJSON = "<p>Evan Gabriel wasn't always a feared and respected North American Federation Navy Commander. Before dangerous missions to the ice-bound planet of Poliahu, the deadly jungle world of Eden, and politically corrupt Mars, he was a simple recruit, fighting to make his mark in the elite Naval Special Forces…and was part of a top-secret military experiment that would change his life forever. </p> <p><i>Zero Point</i> tells the tale of a young man faced with difficult choices and dangerous trials. Fans of the series will see part of the mysterious past Evan Gabriel carries with him, while listeners new to the series get a preview of what is to come in a military man's haunted life. <i>Zero Point</i> is the true beginning of Evan Gabriel, and his story is just getting started. </p>"; 
